    onMapStart() {
        this.setCamera(this.getPlayerSprite(),MapClass.CAMERA_TYPE_SIDESCROLL);
        
        this.addParallaxBackground(this.game.imageList.get('backgrounds/sun'),0,0.0);
        this.addParallaxBackground(this.game.imageList.get('backgrounds/clouds'),(this.game.canvasHeight-400),0.4);
        this.addParallaxBackground(this.game.imageList.get('backgrounds/mountains'),(this.game.canvasHeight-300),0.6);

        this.game.musicList.start('map');
        
        this.addLiquid(this.game.imageList.get('liquids/water_top'),this.game.imageList.get('liquids/water_fill'),3936,5);
    }
    
    onRun(tick) {
        let playerSprite,xAdd,yAdd;
        
        super.onRun(tick);
        
        if ((tick%EyeInTheSkyMapClass.EYE_TICK)===0) {
            playerSprite=this.getPlayerSprite();
            
            xAdd=(Math.random()*EyeInTheSkyMapClass.EYE_OFFSET*2)-EyeInTheSkyMapClass.EYE_OFFSET;
            xAdd+=(playerSprite.flipX?(-EyeInTheSkyMapClass.FORWARD_OFFSET):EyeInTheSkyMapClass.FORWARD_OFFSET);
            yAdd=EyeInTheSkyMapClass.EYE_HEIGHT+(Math.random()*EyeInTheSkyMapClass.EYE_EXTRA_HEIGHT);
            
            this.addSprite(BurningEyeClass,(playerSprite.x+xAdd),(playerSprite.y-yAdd),null);
        }
    }
